class AppTitle extends React.Component {


    constructor(props) {
        super()
        this.state = {
            players: [],
        }
    }

    componentDidMount() {
        fetch('/api/players')
            .then(res => res.json())
            .then(players => this.setState({players: players.playerStatsTotals}))


    }

    render() {
        const names = this.state
        console.log(names);
        return (
            <ul>
            {names.map(name =>
              <li key={name.id}>
                <p>{name.firstName}</p>
              </li>
            )}
          </ul>

            )
    }



}

